A Prairie Home Companion, January 4, 2014 Show #1427: &quot;Away But Never Gone&quot;

This week on A Prairie Home Companion with Garrison Keillor, as single-digit temperatures settle over Minnesota, we'll escape to sunny San Diego, California for a live broadcast from the San Diego Civic Theatre. With special guests, folk trio The Wailin' Jennys and singer-songwriter-fiddler Sara Watkins. Plus, the Royal Academy of Radio Actors, Tim Russell, Sue Scott, and Fred Newman, The Guy's All-Star Shoe Band, and the latest News from Lake Wobegon.
